INSERT INTO `tbl_question` (`id`, `question`, `lower_rate`, `higher_rate`, `date_created`, `date_modified`) VALUES
(1, 'Your family member needs cash to be discharged from the hospital, the only money that you have is the cash collection from your client.<br>To what extent can you influence this situation?\r\n', 'Not responsible at all', 'Completely responsible', '2017-10-27 01:16:30', '0000-00-00 00:00:00'),
(2, 'Your colleague who is same batch with you was promoted to next level position, but you were not promoted.<br>To what extent do you feel responsible for improving the situation?\r\n', 'Completely responsible', 'Not responsible at all', '2017-10-09 04:27:09', '0000-00-00 00:00:00'),
(3, 'You rendered extended work hours to complete a  project, unfortunately it was disapproved because it lacks in quality.<br>The consequences of this situation will:\r\n', 'Affect all aspects of my life', 'Be limited to this situation', '2017-10-10 01:35:28', '0000-00-00 00:00:00'),
(4, 'You accidentally shredded an important original documents.<br>The consequences of this situation will:', 'Quickly Pass', 'Last Forever\r\n', '2017-10-09 04:27:04', '0000-00-00 00:00:00'),
(5, 'Your boss advised you that the high-income generating project assigned to you was lost.<br>The consequences of this situation will:\r\n', 'Affect all aspects of my life', 'Be limited to this situation', '2017-10-09 03:54:29', '0000-00-00 00:00:00'),
(6, 'According to your boss\'s secretary, there is no available slot for you to discuss an important issue pertaining to your personal matter affecting work.<br>To what extent do you feel responsible for improving this situation?\r\n', 'Completely responsible', 'Not responsible at all', '2017-10-09 04:26:49', '0000-00-00 00:00:00'),
(7, 'Majority of the committee members rejected your bright ideas during the coordination meeting.<br>To what extent can you influence this situation?\r\n', 'Not responsible at all', 'Completely responsible', '2017-10-27 01:20:24', '0000-00-00 00:00:00'),
(8, 'Three months before the actual birthday celebration of the special member of the family, you received your superior\'s approval for the requested one day vacation leave. However, the HR suddenly announced that there will be an important company event on the same day.<br>The consequences of this situation will:\r\n', 'Quickly Pass', 'Last Forever\r\n', '2017-10-10 00:42:38', '0000-00-00 00:00:00'),
(9, 'You arrived late for a kick-off meeting with one of your big clients despite of the travel time allowance allotted.<br>The consequences of this situation will:', 'Affect all aspects of my life', 'Be limited to this situation', '2017-10-10 01:28:42', '0000-00-00 00:00:00'),
(10, 'Your business trip/flight has been redirected to another area due to bad weather causing delay.<br>The consequences of this situation will:\r\n', 'Completely responsible', 'Not responsible at all', '2017-10-27 01:20:21', '0000-00-00 00:00:00'),
(11, 'Based on your weekly list of items to be achieved, it was so obvious that you are lack of manpower to support the deadline.<br>To what extent do you feel responsible for improving this situation?\r\n', 'Not responsible at all', 'Completely responsible', '2017-10-09 03:57:05', '0000-00-00 00:00:00'),
(12, 'You missed the deadline for review and approval of daily attendance record resulting to no salary of the whole team.<br>The consequences of this situation will:\r\n', '	Be limited to this situation', 'Affect all aspects of my life', '2017-10-09 04:25:50', '0000-00-00 00:00:00'),
(13, 'You promised to go home early for dinner with family but you did not make it because of unexpected call of duty.<br>To what extent can you influence this situation?\r\n', 'Not responsible at all', 'Completely responsible', '2017-10-27 01:20:16', '0000-00-00 00:00:00'),
(14, 'You are receiving salary lower than your financial obligations but you love your job. An old friend is offering great opportunity.<br>The consequences of this situation will:\r\n', '	Quickly Pass', 'Last Forever\r\n', '2017-10-09 04:25:29', '0000-00-00 00:00:00'),
(15, 'You are mandated to attend for a group meeting as a project owner, unfortunately you did not get enough sleep last night due to family member commitment.<br>To what extent can you influence this situation?\r\n', 'Not responsible at all', 'Completely responsible', '2017-10-27 01:20:11', '0000-00-00 00:00:00'),
(16, 'You stayed for the company more than a number of years required in the employment contract yet its vision and mission seems impossible to achieve.<br>To what extent do you feel responsible for improving this situation?\r\n', 'Completely responsible', 'Not responsible at all', '2017-10-09 04:25:09', '0000-00-00 00:00:00'),
(17, 'You were about to send an important email when the internet connection error occurred.<br>To what extent can you influence this situation?\r\n', 'Last Forever\r\n', 'Quickly Pass', '2017-10-09 04:24:51', '0000-00-00 00:00:00'),
(18, 'You are focusing on an important deadline when all of a sudden, an irritated co-worker forced you to listen to him while he\'s discussing his frustration in a particular output that is obviously a result of his being unorganized.<br>To what extent do you feel responsible for improving this situation?\r\n', 'Be limited to this situation', 'Affect all aspects of my life', '2017-10-09 04:24:40', '0000-00-00 00:00:00'),
(19, 'You lost the confidential document that you left on top of your working table.<br>The consequences of this situation will:\r\n', 'Affect all aspects of my life', 'Be limited to this situation', '2017-10-09 03:59:40', '0000-00-00 00:00:00'),
(20, 'Your boss rejected the funding request you submitted for specific project.<br>The consequences of this situation will:\r\n', 'Quickly Pass', 'Last Forever\r\n', '2017-10-09 04:00:28', '0000-00-00 00:00:00');
